def fix_spaces(text):
    result = []
    current_space_count = 0

    for char in text:
        if char == ' ':
            current_space_count += 1
        else:
            if current_space_count > 2:
                result.append('-')
            else:
                result.append('_' * current_space_count)
            current_space_count = 0
            result.append(char)

    if current_space_count > 2:
        result.append('-')
    else:
        result.append('_' * current_space_count)

    return ''.join(result)

